import React from 'react';
import { Link } from 'react-router-dom';
import './Navbar.css';

function Navbar() {
    return (
        <nav className="navbar">
            <div className="navbar-logo">GEC Alumni</div>
            <ul className="navbar-links">
                <li><Link to="/">Home</Link></li>
                <li><Link to="/registration">Registration</Link></li>
                <li><Link to="/donation-portal">Donation Portal</Link></li>
                <li><Link to="/networking-hub">Networking Hub</Link></li>
                <li><Link to="/job-portal">Job Portal</Link></li>
                <li><Link to="/alumni-directory">Alumni Directory</Link></li>
                <li><Link to="/success-stories">Success Stories</Link></li>
                <li><Link to="/events-reunions">Events & Reunions</Link></li>
                <li><Link to="/feedback-surveys">Feedback & Surveys</Link></li>
            </ul>
        </nav>
    );
}

export default Navbar;
